@staticmethod
def risk_fallback(portfolio_value: float, volatility: float) -> Dict[str, Any]:
    """Fallback for RiskAgent (conservative sizing)."""
    position_size = min(portfolio_value * 0.01, 100.0)
    stop_loss = max(volatility * 2, 0.05)
    return {'action': 'APPROVE', 'position_size': position_size, 'stop_loss': stop_loss, 'risk_score': 7, 'position_approval': 'REDUCE', 'risks': 'Conservative sizing due to LLM unavailability', 'mode': 'FALLBACK'}
